import React from "react";
import { FlatList, StyleSheet, View } from "react-native";

import AppText from "../components/AppText";
import Screen from "../components/Screen";
import colors from "../config/colors";

//const dyeChoices = choices.dyeChoices;

function Budgets({navi}) {
    return (
      <Screen style={styles.screen}>
        <AppText style={styles.title}>Ingredient Budgets!</AppText>
        <AppText style={styles.header1}>$25</AppText>
        <AppText style={styles.text}>This is a test box for text!</AppText>

      
      </Screen>
    );
}

const styles = StyleSheet.create({
  screen: {
    flex: 1,
    backgroundColor: colors.light,
    justifyContent: "center",
    alignItems: "center",
  },
  container: {
    alignItems: "center",
    justifyContent: "center",
    padding: 10,
    backgroundColor: colors.light,
  },
  title: {
    color: colors.eltrdarkblue,
    fontSize: 40,
    marginBottom: 20,
    marginTop: 250,
  },
  header1: {
    color: colors.eltrdarkblue,
    fontSize: 25,
    marginBottom: 20,
  },
  text1: {
    color: colors.eltrdarkblue,
    fontSize: 10,
  },
  
});

export default FoodDye;
